import React from 'react';
import './Rect.css';
import img_calendar from './Saly-42.png'
import img_shakehands from './Saly-31.png'

function Rectangle() {
    return (
        <div>
            <button className='front'>
                <img className='calendar' src={img_calendar} />
            </button>
        </div>
    )
}
export default Rectangle
